const AuthModal = (setShowModal) => {

    const handleClick = () => {
        setShowModal(false);
    }

    return (
        <div>
            <div onClick={handleClick}>
                <span>&#10006;</span>
            </div>
        </div>
    )
}
export default AuthModal
